import React from 'react';
import './App.css';

import HucksLogo from './Components/HucksLogo';
import Greetings from './Components/Greetings';
import Footer from './Components/Footer'


function App() {
  return (
    <div className="App">
     <HucksLogo/>
    <Greetings/>
    <Footer/>
    </div>
  );
}

export default App;
